import './App.css';
import React from 'react'; 



function App() {
  const title = 'Welcome to the new blog';
  const likes = 50;
  // const person={name:'yoshi',age:30}; object cant be used
  const link="http://www.google.com";

  return (
    <div className="App">
      <div className="content">
        <h1>{title}</h1>
        <p>Liked {likes} times</p>
        <p>{"hello, ninjas "}</p>
        {/* <p>{person}</p> */}   
        <p>{Math.random() * 10}</p>
        <p>{[1,2,3,4,5]}</p>
        <a href={link}>Google Site</a>
      </div>
    </div>
  );
}

export default App;
